  \"2013-03-15T14:32:38.236144\",\n\t\"name\": \"utilitytelecom-cable2007\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The VT Cable System dataset (CABLE2007)
  includes lines depicting the extent of Vermont's cable system as of 12/31/2007.
  Numerous cable companies provide service in Vermont, therefore the data represent
  areas currently served by these cable companies. The cable lines themselves ARE
  NOT depicted in this data layer. Instead, the data layer includes roads (or sections
  of roads) from VT's E911 road centerline layer (EmergencyE911_RDS) which are currently
  served by one or more cable companies. Users should use caution when using this
  data since it may not accurately reflect the current ground conditions. NOTE: This
  data layer is an updated version of CABLE2005.\",\n\t\"license_title\": null,\n\t\"extras\":
